import React, { useState } from "react";
import MovieList from "../../api/MovieList";

export default function AddMovie() {
  const [title, setTitle] = useState("");
  const [rdate, setRdate] = useState("");
  const [rating, setRating] = useState("");
  const [link, setLink] = useState("");
  const [desc, setDesc] = useState("");
  const [genre, setGenre] = useState("");
  const [genreid, setGenreid] = useState("");
  const [dfname, setDfname] = useState("");
  const [dlname, setDlname] = useState("");
  const [dgender, setDgender] = useState("");
  const [noOfMovies, setNoOfMovies] = useState("");
  const [afname, setAfname] = useState("");
  const [alname, setAlname] = useState("");
  const [agender, setAgender] = useState("");
  const [role, setRole] = useState("");

  const handleChanges = async (e) => {
    e.preventDefault();
    try {
      const res=MovieList.post("/add-movie-list", {
        title: title,
        date_of_release: rdate,
        movie_desc: desc,
        genreid: genreid,
        link: link,
        imdb_rating: rating,
      });
    } catch (error) {
      console.log(error.message);
    }
  };

  return (
    <>
      <div className="min-h-full py-12 px-4 sm:px-6 lg:px-8">
        <form action="#" method="POST">
          <div className="shadow overflow-hidden sm:rounded-md">
            <div className="px-8 py-5 bg-white sm:p-6">
              <div className="grid grid-cols-6 gap-6">
                <div className="col-span-6 sm:col-span-6 lg:col-span-4">
                  <label
                    htmlFor="title"
                    className="block text-sm font-medium text-gray-700"
                  >
                    Movie Title
                  </label>
                  <input
                    type="text"
                    name="title"
                    id="title"
                    value={title}
                    onChange={(e) => {
                      setTitle(e.target.value);
                    }}
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>
                <div className="col-span-6 sm:col-span-4 lg:col-span-2">
                  <label
                    htmlFor="rdate"
                    className="block text-sm font-medium text-gray-700"
                  >
                    Date Of Release
                  </label>
                  <input
                    type="date"
                    name="rdate"
                    id="rdate"
                    value={rdate}
                    onChange={(e) => {
                      setRdate(e.target.value);
                    }}
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>
                <div className="col-span-6">
                  <label
                    htmlFor="link"
                    className="block text-sm font-medium text-gray-700"
                  >
                    Movie Link
                  </label>
                  <input
                    type="text"
                    name="link"
                    id="link"
                    value={link}
                    onChange={(e) => {
                      setLink(e.target.value);
                    }}
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>
                <div className="col-span-6">
                  <label
                    htmlFor="desc"
                    className="block text-sm font-medium text-gray-700"
                  >
                    Movie Description
                  </label>
                  <textarea
                    rows="4"
                    cols="50"
                    name="desc"
                    id="desc"
                    value={desc}
                    onChange={(e) => {
                      setDesc(e.target.value);
                    }}
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>

                <div className="col-span-6 sm:col-span-3 lg:col-span-2">
                  <lable
                    htmlFor="rating"
                    className="block text-sm font-medium text-gray-700"
                  >
                    IMDB rating
                  </lable>
                  <input
                    type="number"
                    name="rating"
                    value={rating}
                    onChange={(e) => {
                      setRating(e.target.value);
                    }}
                    id="rating"
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>

                <div className="col-span-6 sm:col-span-3 lg:col-span-2">
                  <label
                    htmlFor="genre"
                    className="block text-sm font-medium text-gray-700"
                  >
                    Genre
                  </label>
                  <input
                    type="text"
                    name="genre"
                    value={genre}
                    onChange={(e) => {
                      setGenre(e.target.value);
                    }}
                    id="genre"
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outlin"
                  />
                </div>

                <div className="col-span-6 sm:col-span-3 lg:col-span-2">
                  <label
                    htmlFor="postal-code"
